import "./App.css";
import React, {useState} from "react";
import {OptimizeSvg} from "./OptimizeSvg";
import Images from "./Images";
import inputSvg from "./userData/input.svg";

function App() {
    const [userInputProcessed, setUserInputProcessed] = useState(false);

    if (!userInputProcessed) {
        setUserInputProcessed(OptimizeSvg(inputSvg));
    }

    return (
        <div className="App">
            <header className="App-header">SVG Optimizer</header>
            <Images userInputProcessed={userInputProcessed} />
            <section className="App-settings"></section>
        </div>
    );
}

export default App;
